import React from 'react';

const LegalAndPaymentOptions = () => {
    return (
        <div className="legal-payment-options">
            <h2>Legal and Payment Options</h2>
            <div className="arbitrator-section">
                <h3>Get an Arbitrator</h3>
                <button>Request Arbitrator</button>
            </div>
            <div className="legal-counsel-section">
                <h3>Seek Legal Counsel</h3>
                <button>Request Legal Counsel</button>
            </div>
            <div className="payment-section">
                <h3>Make a Payment</h3>
                <button>Pay Now</button>
            </div>
        </div>
    );
};

export default LegalAndPaymentOptions;
